@-moz-document domain("edmodo.com") {
#topbar {
    background: #607D8B;
    padding: 0;
    box-shadow: 0 2px 4px rgba(0,0,0,.15);
    border-bottom: 1px solid #004688;
    position: fixed;
    width: 100%;
    top: 0;
    z-index: 999996;
}
.avatar-container .profile-card {
    overflow: hidden;
    position: relative;
    min-height: 81px;
    cursor: pointer;
    background-color: #E0F2F1;
}


.section {
    box-sizing: border-box;
    width: 100%;
    background-color:  #E0F2F1;
    border: 1px solid;
    border-color: #607D8B #607D8B #607D8B;
    box-shadow: 0 1px 0 0 #607D8B;
    margin-bottom: 14px;
    border-radius: 3px;
    -webkit-border-radius: 3px;
    -moz-border-radius: 3px;
}


.pb-content {
    padding: 20px;
    background:  #E0F2F1;
    border-bottom-left-radius: 2px;
    border-bottom-right-radius: 2px;
}
